import Typist from 'react-typist'
import './App.css';

const NameBox = () => {
  return (
    <div className="LandingPage-NameBox">
      <p className="LandingPage-Name" style={{ color: '#fffff0'}}>Kyle Gloria</p>
      <p className="LandingPage-Name">Kyle Gloria</p>
      <p className="LandingPage-Name" style={{ color: '#ffffe0' }}>Kyle Gloria</p>
    </div>     
  )
}

const App = () => {
  return (
    <div className="App">
      <header className="App-header"> 
          <NameBox/>
          <p>
          Full Stack Developer | IT Professional
          </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn More
        </a>
      </header>
    </div>
  );
}

export default App;
